import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
//import logo from './logo.svg';
import { render } from 'react-dom';
import Typed from 'react-typed';

import './App.css';

import './css/stylesheet.css';
import './css/mmenu.css';
import './css/style.css';
import AdBannerImg from './img/2.jpg';
import './components/FontawesomeIcons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import 'font-awesome/css/font-awesome.min.css';
import Header from './components/Header';
import Topbanner from './components/Topbanner';
import Promoted from './components/Promoted';
import Todayhot from './components/Todayhot';
import Footer from './components/Footer';
import Addcoin from './components/Addcoin';

class App extends Component{
	render() {
		return (
			<div className="App">
				<div id="main_wrapper">
					<Header />
					<div className="clearfix"></div>
					<BrowserRouter>
					<Topbanner />
					<Promoted />
					<Todayhot />
					<a href="listings_grid_full_width.html" className="flip-banner parallax" data-background={AdBannerImg} data-color={'#000'} data-color-opacity={'0.85'} data-img-width={'2500'} data-img-height={'1666'}>
						<div className="flip-banner-content">
							<h2 className="flip-visible">Advertisement Banner</h2>    
						</div>
					</a>
					<Addcoin />
					</BrowserRouter>
				</div>
				<Footer />
			</div>

		);
	}
}

export default App;
